import {Routes,BrowserRouter,Route} from 'react-router-dom'
import './App.css';

function App() {
  return (
    <div className="App">
      <BrowserRouter>
        <Routes>
          <Route path='/' element={<h1>HELLO</h1>}/>
          <Route path='/companies' element={<h1>HELLO</h1>}/>
          <Route path='/companies/:name' element={<h1>HELLO</h1>}/>
          <Route path='/jobs' element={<h1>HELLO</h1>}/>
          <Route path='/login/' element={<h1>HELLO</h1>}/>
          <Route path='/signup' element={<h1>HELLO</h1>}/>
          <Route path='/profile' element={<h1>HELLO</h1>}/>
        </Routes>
      </BrowserRouter>
    </div>
  );
}

export default App;
